import {Route, Routes , BrowserRouter} from 'react-router-dom';

import Nav from './Day3/Nav.jsx';
import Home from './Day3/Home.jsx';
import About from './Day3/About.jsx';
// import EditEmp from './EditEmp';

class App extends Component{
    state = {
        EmpL: null,
        JSONplaceHolderArray: null,
    };

    render() {
        return(
        <BrowserRouter>
            <Nav></Nav>
            <Route path="/About" component={About}/>
            <Route path="/Home" component={Home}/>
        </BrowserRouter>
        )
    }
}

export default App ;
